import React from 'react';
import '../Styles/pagina-inicial.css';
import { Link } from 'react-router-dom';
import logo from '../logo.png';
import { Stack, Button, Typography } from '@mui/material';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import Divider from '@mui/material/Divider';
import CssBaseline from '@mui/material/CssBaseline';

const darkTheme = createTheme({ palette: { mode: 'dark', }, });


function PaginaInicial() {
  return (
    <Container component="main" maxWidth="xs">
      <Box sx={{ marginTop: 8, display: 'flex', flexDirection: 'column', alignItems: 'center', }}>
        <Stack spacing={2} direction='row'>
          <Button variant="contained" color="primary">Login</Button>
          <Button variant="contained" color="secondary">Cadastro</Button>
        </Stack>

        <Typography variant="h1">Pet Cemetery</Typography>
        <img src={logo} alt="logo" className='logoImg'></img>

        <Stack spacing={2} direction='column' divider={<Divider orientation="horizontal" flexItem />}>
          <Button variant="contained">Quem somos</Button>
          <Button variant="contained">Conhe√ßa nossos planos</Button>
          <Button variant="contained">Contato</Button>
        </Stack>
      </Box>
    </Container>
  );
}

export default PaginaInicial;
